-- ----------------------------
-- View structure for viewpenjualan
-- ----------------------------
DROP VIEW IF EXISTS `viewpenjualan`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `viewpenjualan` AS select `pembayaran`.`invoice` AS `invoice`,`pembayaran`.`tanggal` AS `tanggal`,`pembayaran`.`total_biaya` AS `total_biaya`,`pembayaran`.`tunai` AS `tunai`,`pembayaran`.`kembalian` AS `kembalian`,`pembayaran`.`status` AS `status_pembayaran`,`sewa`.`id_sewa` AS `id_sewa`,`sewa`.`tgl_checkin` AS `tgl_checkin`,`sewa`.`lama_sewa` AS `lama_sewa`,`sewa`.`id_kamar` AS `id_kamar`,`sewa`.`id_customer` AS `id_customer`,`customer`.`nama` AS `nama`,`customer`.`kota` AS `kota`,`customer`.`status` AS `status`,`kamar`.`biaya` AS `biaya`,`kamar`.`nomor_kamar` AS `nomor_kamar`,`kamar`.`status` AS `status_kamar` from (((`pembayaran` join `sewa`) join `customer`) join `kamar`) where `pembayaran`.`id_sewa` = `sewa`.`id_sewa` and `sewa`.`id_customer` = `customer`.`id_customer` and `kamar`.`id_kamar` = `sewa`.`id_kamar` ;

SET FOREIGN_KEY_CHECKS = 1;
